jQuery.fn.dataTableExt.oApi.fnGetHiddenNodes=function(settings){var nodes;var display=jQuery("tbody tr",settings.nTable);if(jQuery.fn.dataTable.versionCheck){var api=new jQuery.fn.dataTable.Api(settings);nodes=api.rows().nodes().toArray()}else{nodes=this.oApi._fnGetTrNodes(settings)}for(var i=0;i<display.length;i++){var iIndex=jQuery.inArray(display[i],nodes);if(iIndex!=-1){nodes.splice(iIndex,1)}}return nodes};